  ?place dbo:location ?location ;
         dbp:range ?range .
  ?location dbo:parent ?parent ;
            rdfs:label ?label .
  ?parent rdfs:label "Urals"@en .
}
ORDER BY DESC(?range)
LIMIT 1

PREFIX dbo: <http://dbpedia.org/ontology/>
